import Comment from "./Comment";

const App = () => {
  return (
    <div className="ui container comments">
      <Comment name="Sam" time="Today at 6pm" text="Nice blog post" />
      <Comment name="John" time="Today at 7pm" text="Nice blog post" />
      <Comment name="Sara" time="Today at 8pm" text="Nice blog post" />
    </div>
  );
};

export default App;
